import logo from './logo.svg';
import './App.css';
import Food from './Food.js';
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';





function App() {

    async function SearchImage(searchText) {
        var outString = "Something went wrong";
        await fetch('https://api.imgur.com/3/gallery/search/top?q=' + searchText + ' ext: png OR jpg', //search by given text for filetype png/jpg
            {
                method: 'get',
                headers: {
                    //"Access-Control-Allow-Headers": "Authorization",
                    "Authorization": "Client-ID e4f15a9a27fb199" //This header may be wrong
                }
            })
            .then(
                function (response) {
                    if (response.status !== 200) {
                        console.log('Error performing imgur api call. Status Code ' +
                            response.status);
                        return "/static/images/cards/contemplative-reptile.jpg";
                    }

                    response.json().then(function (data) {
                        //do things with data here
                        console.log(data);
                        //console.log(data.data);
                        for (var i = 0; i < data.data.length; i++) {
                            if (data.data[i].nsfw || data.data[i].is_album) {
                                continue;
                            }
                            console.log(data.data[i].link)
                            outString = data.data[i].link;
                            return data.data[i].link;
                            break;
                        }
                    })
                }
            )
            .catch(function (err) {
                console.log('Fetch Error: ', err);
            });
        return outString;
    }

    //SearchImage("bananna");

  return (
    
    <div className="App">
      <div className="Cards">
        <Food text="Food name" img={SearchImage("hamburger")} altText="hamburger"/>
        <Food text="Food name" img={SearchImage("hamburger")} />
        <Food text="Food name" img={SearchImage("hamburger")} />
      </div>
      <div className="itemAdder"></div>

     
      
     
  
    </div>
  );
}

export default App;
